import React, { Component } from 'react';
import '../../Globals.css';
import './Button.css';

class Button extends Component {
  render() {
    return (
      <div onClick={() => this.props.handleBtnClick("add")} className="Button">
        <button>{this.props.text}</button>
      </div>
    );
  }
}

export default Button;
